"ПОМОГАЕТ ПОСЛЕ ТЯЖЕЛОГО ТРУДОВОГО РАБОЧЕГО ДНЯ": 

Для игры Вам понадобится: Человек (Вы сами), ванная с натянутыми над ней верёвками-лесками для сушки белья, колготки. Как играть: Надеваете колготки попой на голову, залезаете в ванну, встаёте в ней в полный рост, ноги (колготочные, не свои) забрасываете на верёвки для сушки белья. Медленно трогаетесь с места и делаете несколько шагов вперёд. Вы - троллейбус. Если при этом надетьлыжи - получается трамвай. А если надеть лыжи и налить в ванну воды - получается речной трамвай, а если в ванну с водой уронить включенный фен, то получится электричка, а если выключить свет и одеть налобный фонарик, то Вы - метро. А если добавить в воду керосина, то получится самолет, если при этом в воде останется фен - все, Вы - ракета!
))))))))))))))))))))))))))))))))))))))))))))))))))))))))))))))
